import './App.css';

const App = () => {
  return (
    <div className="App">
      <Header/>
      <Technologies/>
    </div>
  );
}

const Header = () => {
  return (
    <div className="Header">
      <a href="#s">Home </a>
      <a href="#s">News </a>
      <a href="#s">Mesages</a>
    </div>
  );
}

const Technologies = () => {
  return (
    <div className="Technologies">
      <ul>
        <li>HTML</li>
        <li>CSS</li>
        <li>JavaScript</li>
        <li>React.js</li>
      </ul>
    </div>
  );
}

export default App;
